//toggle header visibility on scroll
function toggleHeaderHandler() {
  //Hide Header on scroll down
  var didScroll;
  var lastScrollTop = 0;
  var delta = 5;
  var navbarHeight = $('header').outerHeight();

  $(window).scroll(function (event) {
    didScroll = true;
  });

  //as scroll listeners are very expensive =>
  //check only on intervals
  setInterval(function () {
    if (didScroll) {
      hasScrolled();
      didScroll = false;
    }
  }, 250);


  function hasScrolled() {
    var st = $(this).scrollTop();

    // Make sure they scroll more than delta
    if (Math.abs(lastScrollTop - st) <= delta)
      return;

    // If they scrolled down and are past the navbar, add class .nav-up.
    // This is necessary so you never see what is "behind" the navbar.
    if (st <= (window.innerHeight / 2) || (st > lastScrollTop && st > navbarHeight)) {
      // Scroll Down
      $('header').removeClass('nav-down').addClass('nav-up');
    } else {
      // Scroll Up
      if (st + $(window).height() < $(document).height()) {
        $('header').removeClass('nav-up').addClass('nav-down');
      }
    }

    lastScrollTop = st;
  }
}

//rendering intro animation (lottie svg)
const renderIntro = (data) => {
  /* Play an animation on each click */
  let iconSkipForward = document.getElementById('bm');

  let animationSkipForward = bodymovin.loadAnimation({
    container: iconSkipForward,
    renderer: 'svg',
    loop: false,
    autoplay: false,
    //path: '/video/data.json',
    animationData: data
  });

  iconSkipForward.addEventListener('click', function () {
    animationSkipForward.play();
    animationSkipForward.addEventListener('complete', () => animationSkipForward.goToAndStop(0, true));
  });
}

